import "../index.css";

const { Meta } = Card;

function MovieCard({ title, description, posterUrl, rate }) {
  return (
    <div className="movieCard">
      <Card hoverable style={{}} cover={<img alt={title} src={posterUrl} />}>
        <Meta title={title} description={description} />
      </Card>
    </div>
  );
}

export default MovieCard;
